import React from 'react';
import IconButton from './IconButton';
import sadsmiley from '../../images/sad_smiley.png';
import happysmiley from '../../images/smile.png'

const Footer = ({onAction}) => {
  return (
  <div className="hero-foot has-background-light has-text-centered level">
   <div className="level-left">
   <div className="level-item"><IconButton className="container is-fullhd" url={sadsmiley} onAction={onAction} /></div></div> 
   <div className="level-right"> <div className="level-item"><IconButton className="container is-fullhd" url={sadsmiley} onAction={onAction} /></div></div> 
  </div> 
   )
}

export default Footer;
